import React, { Component } from 'react'
import { withRouter } from 'react-router-dom'
import { Button, Form, Upload, Input, Card, message, Table, Tag, Space } from 'antd'
import { PlusOutlined } from '@ant-design/icons';
import { connect } from 'react-redux';

const { Column, ColumnGroup } = Table;

const data = [
    {
        key: '1',
        firstName: 'John',
        lastName: 'Brown',
        age: 32,
        address: 'New York No. 1 Lake Park',
        tags: ['nice', 'developer'],
    },
    {
        key: '2',
        firstName: 'Jim',
        lastName: 'Green',
        age: 42,
        address: 'London No. 1 Lake Park',
        tags: ['loser'],
    },
    {
        key: '3',
        firstName: 'Joe',
        lastName: 'Black',
        age: 32,
        address: 'Sidney No. 1 Lake Park',
        tags: ['cool', 'teacher'],
    },
];

class GICheck extends Component {
    render() {
        const title = 'Check Domestic Mobility Proxy Forms';
        const extra = (<Button type="primary" icon={<PlusOutlined />} onClick={() => this.props.history.push('/dashboard/gi-submit')}>Add</Button>)
        return (
            <Card title={title} extra={extra}>
                <Table dataSource={data}>
                    <ColumnGroup title="Name">
                        <Column title="First Name" dataIndex="firstName" key="firstName" />
                        <Column title="Last Name" dataIndex="lastName" key="lastName" />
                    </ColumnGroup>
                    <Column title="Age" dataIndex="age" key="age" />
                    <Column title="Address" dataIndex="address" key="address" />
                    <Column
                        title="Tags"
                        dataIndex="tags"
                        key="tags"
                        render={tags => (
                            <>
                                {tags.map(tag => {
                                    let color = "blue"
                                    return (
                                        <Tag color={color} key={tag}>
                                            {tag}
                                        </Tag>
                                    )
                                })}
                            </>
                        )}
                    />
                    <Column
                        title="Action"
                        key="action"
                        render={(text, record) => (
                            <Space size="middle">
                                <a>Details</a>
                            </Space>
                        )}
                    />
                </Table>
            </Card>
        )
    }
}

export default connect(
    state => ({}),
    {}
)(withRouter(GICheck))
